import React from 'react';
import {withRouter} from 'react-router-dom'

class Lawlist extends React.Component{
    constructor(props){
        super(props)
        this.clickHandler = this.clickHandler.bind(this)
    }
    clickHandler(event){
        event.preventDefault()
        let path = '/'
        this.props.history.push(path)
    }
    render(){
        return(
            <center>
                <div classname="btn-group btn-matrix">
                    <button type="button" className="btn btn-default" value="ekaLaki" onClick={this.clickHandler}>Eka Laki</button>
                    <button type="button" className="btn btn-default" value="tokaLaki" onClick={this.clickHandler}>Toka laki</button>
                    <button type="button" className="btn btn-default" value="kolLaki" onClick={this.clickHandler}>Kolmas laki</button>
                    <button type="button" className="btn btn-default" value="nelLaki" onClick={this.clickHandler}>Neljäs laki</button>
                    <button type="button" className="btn btn-default" value="viiLaki" onClick={this.clickHandler}>Viides laki</button>
                    <button type="button" className="btn btn-default" value="kuuLaki" onClick={this.clickHandler}>Kuudes laki</button>
                    <button type="button" className="btn btn-default" value="seiLaki" onClick={this.clickHandler}>Seitsemäs laki</button>
                    <button type="button" className="btn btn-default" value="kasLaki" onClick={this.clickHandler}>Kahdeksas laki</button>
                    <button type="button" className="btn btn-default" value="ysiLaki" onClick={this.clickHandler}>Yhdeksäs laki</button>
                </div>
                <div>
                    <center><button className="btn btn-primary mt-3 mb-3">Select</button></center>
                </div>
            </center>
        )
    }
}

export default withRouter(Lawlist)
